    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Theodore Roosevelt NWR Complex for the next 15
    years. This plan outlines the Complex vision and purpose and describes how the Complex
    will contribute to the overall mission of the Refuge System. The plan provides an
    introduction to the Complex, an overview of the CCP process, information about plan
    development and the management direction, and strategies for implementation. Key
    planning issues include: fish and wildlife populations, habitats, visitor services,
